import React, { Component } from 'react';
import styled from 'styled-components';

const Box = styled.div`
    padding: 10px 24px;
    min-height: 25px;
    background-color: #eeeeee;
`;

class Box__nav extends Component {
    render() {
        return (
            <Box>
                <a href="#"></a>
            </Box>
        )
    }
}

export default Box__nav;
